export class ComplicationAgAnemie
{
    PatientID:number;
    IdAgAnemie:number;
    AggravationAnemie:boolean;
    Nombre:number;
    Date:string;
    AggravationPaleur:boolean;
    AggravationIctere:boolean;
    UrinesPlusFoncee:boolean;
    Fievre:boolean;
    AugmentationVolumeRate:boolean;
    PreciserAvr:number;
    SigneChoc:boolean;
    Autre:boolean;
    PreciserAutre:string;
    Hemogramme:number;
    Hb:number;
    Recticulocytes:number;
    Pnn:number;
    Plaquettes:number;
    LieuHospitalisation:string;
    HyperhydratationPerso:boolean;
    HyperhydratationIv:boolean;
    AntalgiquesPalliesI:boolean;
    AntalgiquePallierIi:boolean;
    AntalgiquePallierIii:boolean;
    TransfusionSimple:boolean;
    AutreTraitement:boolean;
    PreciserAutreTraitement:string;
    DiagnosticPresume:string;
    constructor()
    {
        this.PatientID=0;
        this.IdAgAnemie=0;
        this.AggravationAnemie=false;
        this.Nombre=0;
        this.Date='';
        this.AggravationPaleur = false;
        this.AggravationIctere = false;
        this.UrinesPlusFoncee = false;
        this.Fievre = false;
        this.AugmentationVolumeRate = false;
        this.PreciserAvr = 0;
        this.SigneChoc = false;
        this.Autre = false;
        this.PreciserAutre = '';
        this.Hemogramme = 0;
        this.Hb = 0;
        this.Recticulocytes = 0;
        this.Pnn = 0;
        this.Plaquettes = 0;
        this.LieuHospitalisation = '';
        this.HyperhydratationPerso = false;
        this.HyperhydratationIv = false;
        this.AntalgiquesPalliesI = false;
        this.AntalgiquePallierIi = false;
        this.AntalgiquePallierIii = false;
        this.TransfusionSimple = false;
        this.AutreTraitement = false;
        this.PreciserAutreTraitement = '';
        this.DiagnosticPresume = '';
    }
}
